B.aC3=new A.RS("Automatic Image Slider",35,"Automatic","class AutoImageSlider extends StatefulWidget {\n  const AutoImageSlider({super.key});\n\n  @override\n  State<AutoImageSlider> createState() => _AutoImageSliderState();\n}\n\nclass _AutoImageSliderState extends State<AutoImageSlider> {\n  final PageController _controller = PageController();\n  final List<String> images = [\n    'assets/eample.jpg',\n    'assets/example2.jpg',\n    'assets/example3.jpg',\n  ];\n  int _currentPage = 0;\n  late Timer _timer;\n\n  @override\n  void initState() {\n    super.initState();\n    // Add listener to detect changes in the page\n    _controller.addListener(() {\n      if (_controller.page != null) {\n        setState(() {\n          _currentPage = _controller.page!.round();\n        });\n      }\n    });\n\n    // Start a timer to automatically change the page every 3 seconds\n    _timer = Timer.periodic(const Duration(seconds: 3), _autoChangePage);\n  }\n\n  @override\n  void dispose() {\n    // Dispose the controller and cancel the timer when the widget is disposed\n    _controller.dispose();\n    _timer.cancel();\n    super.dispose();\n  }\n\n  void _navigateToPage(int page) {\n    _controller.animateToPage(\n      page,\n      duration: const Duration(milliseconds: 300),\n      curve: Curves.easeInOut,\n    );\n  }\n\n  // Method to automatically change the page\n  void _autoChangePage(Timer timer) {\n    if (_currentPage < images.length - 1) {\n      _navigateToPage(_currentPage + 1);\n    } else {\n      _navigateToPage(0); // Loop back to the first image\n    }\n  }\n\n  @override\n  Widget build(BuildContext context) {\n    return Card(\n      elevation: 4,\n      shape: const RoundedRectangleBorder(\n        borderRadius: BorderRadius.all(Radius.circular(12)),\n      ),\n      child: Container(\n        width: 500,\n        height: 250, // Set height for the image slider\n        decoration: const BoxDecoration(\n          color: Colors.white,\n          borderRadius: BorderRadius.all(Radius.circular(12)),\n          boxShadow: [\n            BoxShadow(\n              color: Colors.black12,\n              blurRadius: 8,\n              offset: Offset(0, 4),\n            ),\n          ],\n        ),\n        child: Stack(\n          children: [\n            PageView.builder(\n              controller: _controller,\n              itemCount: images.length,\n              itemBuilder: (context, index) {\n                return ClipRRect(\n                  borderRadius: BorderRadius.all(Radius.circular(12)),\n                  child: Image.asset(\n                    images[index],\n                    fit: BoxFit.cover,\n                    width: double.infinity,\n                  ),\n                );\n              },\n            ),\n            // Pagination Indicator\n            Positioned(\n              bottom: 10,\n              left: 10,\n              child: Row(\n                children: List.generate(images.length, (index) {\n                  return Container(\n                    margin: const EdgeInsets.symmetric(horizontal: 4),\n                    width: 8,\n                    height: 8,\n                    decoration: BoxDecoration(\n                      color: _currentPage == index\n                          ? Colors.blue\n                          : Colors.grey,\n                      shape: BoxShape.circle,\n                    ),\n                  );\n                }),\n              ),\n            ),\n          ],\n        ),\n      ),\n    );\n  }\n}",B.Sc,null)
